import React from 'react';

const Instructions = () => {
    return (
        <div>
            <h1>Distance Healing Instructions</h1>
            <ul>
                <li>1. Visualize divine light and love entering you and filling you.
Believe this energy is within yourself and then you can radiate it outward.
</li>
<li>2. Visualize the person you want to heal
Feel the divine light and love moving outward from you to that person. Do this from a state of mind of total relaxation and acceptance with no doubt of the effectiveness. Simply allowing the divine to do its work.


</li>
            </ul>
        </div>
    );
};

export default Instructions;
